    // const usersFilterSearch = users && search ? users.filter(user => user.name.toLowerCase().includes(search.toLocaleLowerCase())) : users
    return (
        <>
            {/* {goods.map(good => (category === '' || good['Артикул'][0] === category) && <Tiser data={good} key={good['Артикул']} />)} */}
            {goods.map(good => <Tiser data={good} key={good['Артикул']} />)}
        </>
    )
}

export default TiserList
